import React from 'react';
import './footer.scss';

const links =["a", "b", "c"];

function Links({links}) {
  return(
    <ul className="footer-links">
      {links.map((link) => (
        <li className="footer-links"><a href="#">{link}</a></li>
      ))}

    </ul>
  )
}

function Footer() {
  return(
    <Links links={links}></Links>
  )
}

export default Footer;
